import Pagination from "../../components/Pagination"
import Products from "../../components/Products"

const ProductsPage = () => {
    const {query} = useRouter()
    const page = parseInt(query.page)
    return <div>
        <Pagination page={page || 1} />
        <Products />
        <Pagination page={page || 1}/>
    </div>
}

export default ProductsPage
